CREATE DEFINER=`root`@`localhost` FUNCTION `exe01` (`nome_topic` VARCHAR(100)) RETURNS VARCHAR(100) CHARSET utf8 BEGIN
DECLARE result varchar(100);

set result = (SELECT post.title, age_name, civ_name, post_type
FROM post, age, topic, age_has_topic, civilization, post_has_civilization, type
WHERE idperiodo = post.age_idperiodo
AND idperiodo = age_has_topic.age_idperiodo
AND idtopic = age_has_topic.topic_idtopic
AND idpost = post_has_civilization.post_idpost
AND idcivilization = post_has_civilization.civilization_idcivilization
AND idtype = post.type_idtype
AND post_type = "Artigo de História"
AND topic.title = nome_topic);

RETURN result;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `exe02` (`nome_topic` VARCHAR(100)) RETURNS INT(11) BEGIN
declare result integer;

set result = (SELECT COUNT(idpost)
FROM post, topic, post_has_topic, type
WHERE idtopic = post_has_topic.topic_idtopic
AND idpost = post_has_topic.post_idpost
AND idtype = post.type_idtype
AND post_type = "Artigo de História"
AND topic.title = nome_topic);

RETURN result;
END$$

DELIMITER ;

