INSERT INTO `age` (`idperiodo`, `age_name`, `desc_age`) VALUES
(1, 'Pré-História', 'Quando adentramos o estudo da Antiguidade ou Idade Antiga, é bastante comum ouvir dizer que esse período histórico é marcado pelo surgimento das primeiras civilizações. Geralmente, ao adotarmos a expressão “civilização” promove-se uma terrível confusão que coloca os povos dessa época em uma condição superior se comparados às outras culturas do mesmo período.\r\n\r\nNa verdade, a existência de uma civilização não tem nada a ver com essa equivocada ideia de que exista um povo “melhor” ou “mais evoluído” que os demais. O surgimento das primeiras civilizações simplesmente demarca a existência de uma série de características específicas. Em geral, uma civilização se forma quando apontamos a existência de instituições políticas complexas, uma hierarquia social diversificada e de outros sistemas e convenções que se aplicam largamente a uma população.\r\n\r\nAo contrário do que se possa imaginar, não podemos apontar uma localidade específica onde encontremos a formação das primeiras civilizações da história. O processo de fixação e desenvolvimento das relações sociais aconteceu simultaneamente em várias regiões e foi marcado pelo contato entre civilizações, bem como a incorporação de duas ou mais culturas na formação de outra civilização.\r\n\r\nReportando-se ao Mundo Oriental, podemos assinalar o desenvolvimento das milenares civilizações chinesa e indiana. Partindo mais a oeste, localizamos a formação da civilização egípcia e dos vários povos que dominaram a região Mesopotâmica, localizada nas proximidades dos rios Tigre e Eufrates. Também conhecidas como civilizações hidráulicas, essas culturas agruparam largas populações que sobreviviam da exploração das águas e terras férteis presentes na beira dos rios.\r\n\r\nNa parte ocidental do planeta, costuma-se dar amplo destaque ao surgimento da civilização greco-romana. O prestígio dado a gregos e romanos justifica-se pela forte e visível influência que estes povos tiveram na formação dos vários conceitos, instituições e costumes que permeiam o Ocidente como um todo. Contudo, não podemos também deixar de dar o devido destaque aos maias, astecas, incas e olmecas que surgem no continente americano.\r\n\r\nSem dúvida, o estudo das civilizações antigas se mostra importante para que possamos entender melhor sobre as várias feições que a nossa cultura assume atualmente. Contudo, sob outro ponto de vista, o estudo da Antiguidade também abre caminho para que possamos contrapor os valores e parâmetros que um dia foram comuns a alguns homens e hoje se mostram tão distantes do que vivemos. É praticamente infinito o leque de saberes que se aplica a esse período histórico.'),
(2, 'Antiguidade', 'Quando adentramos o estudo da Antiguidade ou Idade Antiga, é bastante comum ouvir dizer que esse período histórico é marcado pelo surgimento das primeiras civilizações. Geralmente, ao adotarmos a expressão “civilização” promove-se uma terrível confusão que coloca os povos dessa época em uma condição superior se comparados às outras culturas do mesmo período.\r\n\r\nNa verdade, a existência de uma civilização não tem nada a ver com essa equivocada ideia de que exista um povo “melhor” ou “mais evoluído” que os demais. O surgimento das primeiras civilizações simplesmente demarca a existência de uma série de características específicas. Em geral, uma civilização se forma quando apontamos a existência de instituições políticas complexas, uma hierarquia social diversificada e de outros sistemas e convenções que se aplicam largamente a uma população.\r\n\r\nAo contrário do que se possa imaginar, não podemos apontar uma localidade específica onde encontremos a formação das primeiras civilizações da história. O processo de fixação e desenvolvimento das relações sociais aconteceu simultaneamente em várias regiões e foi marcado pelo contato entre civilizações, bem como a incorporação de duas ou mais culturas na formação de outra civilização.\r\n\r\nReportando-se ao Mundo Oriental, podemos assinalar o desenvolvimento das milenares civilizações chinesa e indiana. Partindo mais a oeste, localizamos a formação da civilização egípcia e dos vários povos que dominaram a região Mesopotâmica, localizada nas proximidades dos rios Tigre e Eufrates. Também conhecidas como civilizações hidráulicas, essas culturas agruparam largas populações que sobreviviam da exploração das águas e terras férteis presentes na beira dos rios.\r\n\r\nNa parte ocidental do planeta, costuma-se dar amplo destaque ao surgimento da civilização greco-romana. O prestígio dado a gregos e romanos justifica-se pela forte e visível influência que estes povos tiveram na formação dos vários conceitos, instituições e costumes que permeiam o Ocidente como um todo. Contudo, não podemos também deixar de dar o devido destaque aos maias, astecas, incas e olmecas que surgem no continente americano.\r\n\r\nSem dúvida, o estudo das civilizações antigas se mostra importante para que possamos entender melhor sobre as várias feições que a nossa cultura assume atualmente. Contudo, sob outro ponto de vista, o estudo da Antiguidade também abre caminho para que possamos contrapor os valores e parâmetros que um dia foram comuns a alguns homens e hoje se mostram tão distantes do que vivemos. É praticamente infinito o leque de saberes que se aplica a esse período histórico.'),
(3, 'Idade Média', 'A Idade Média é um dos quatro grandes períodos da história segundo a divisão moderna realizada pelos historiadores. Nela a Idade Média localiza-se entre a Idade Antiga e a Idade Moderna, estendendo-se de 476 a 1453. Sabe-se atualmente que o período medievo trata-se de uma divisão eurocêntrica, uma vez que sua consideração leva em consideração, sobretudo, os acontecimentos relacionados ao continente europeu.\r\n\r\nOs marcos utilizados pelos historiadores para definir-se o início e o fim da Idade Média são:\r\n\r\n⇒ Desagregação do Império Romano do Ocidente, em 476.\r\n\r\n                                                                              ⇒ Conquista de Constantinopla pelo Império Otomano, em 1453.\r\n\r\nEsse período da história foi dividido em dois subperíodos: a Alta Idade Média (séculos V-X) e a Baixa Idade Média (séculos XI-XV). A Idade Média ficou marcada pelo desenvolvimento do feudalismo enquanto modo de produção econômico e sistema de organização política e social. A decadência desse modelo levou ao surgimento de novas formas de organização política e social, que caracterizaram o fim do medievo.\r\n\r\nQuando começou a Idade Média?\r\nComo mencionado, o marco utilizado pelos historiadores para determinar o início da Idade Média foi a desagregação do Império Romano do Ocidente, em 476. Nessa data, o último imperador de Roma, Rômulo Augusto, foi destituído do trono pelos hérulos, povo germânico liderado por Odoacro.\r\n\r\nPortanto, esse acontecimento cronologicamente estipula o início da Idade Média. Isso, porém, não significa que mudanças significativas aconteceram no contexto europeu de um momento para o outro. Então não podemos dizer que o mundo, em 475, era um, e que, em 477, era outro radicalmente diferente.\r\n\r\nEsse marco é utilizado pelos historiadores para estabelecer um acontecimento significativo que precipitou uma série de transformações no continente europeu. O enfraquecimento romano e a penetração dos germânicos na Europa geraram transformações que, ao longo de séculos, resultaram nas características básicas da Idade Média.\r\n\r\n\r\nQuando surgiu o termo “Idade Média”?\r\nO termo “Idade Média” não foi criado pelas pessoas que viveram no medievo, mas sim por pessoas que viveram após ele. Os responsáveis por essa nomenclatura foram os renascentistas, e um dos primeiros a valer-se da ideia por trás dela foi um italiano do século XV chamado Giovanni Andrea|1|.\r\n\r\nEssa nomenclatura possuía uma conotação pejorativa, uma vez que tal “tempo médio” era considerado um período que separava a Europa da tradição clássica (greco-romana). Assim, nessa concepção, houve o período clássico (Antiguidade), interrompido pela Idade Média, entendida negativamente, e, com o fim dela, houve o resgate da tradição clássica ou um “renascimento”.\r\n\r\nA palavra “renascimento” foi utilizada exatamente com o propósito de demonstrar que a humanidade estava renascendo pelo resgate da cultura clássica, entendida como superior. Os renascentistas consideravam que seu período era marcado pelo esplendor artístico e cultural e que a Idade Média era, portanto, uma época de atraso e ruína.\r\n\r\nEsses conceitos negativos ajudaram a consolidar a ideia de que a Idade Média foi a Idade das Trevas, o que é bastante criticado pelos historiadores.\r\n\r\nAcesse também: Como se deu a transição do feudalismo para o capitalismo\r\n\r\nFeudalismo\r\n\r\nTradicionalmente, o feudalismo foi sempre entendido como um modelo exclusivamente econômico, mas a opinião predominante entre os historiadores é a de que se trata de um conceito-chave que nos ajuda a entender muita coisa da Idade Média e que não se aplica exclusivamente ao campo econômico.\r\n\r\nEntão, o conceito de feudalismo vale para entender, além da questão econômica, toda a organização social, política, cultural e ideológica da Europa medieval. Seu período clássico existiu entre os séculos XI e XIII. O período anterior — século V ao X — é entendido como o momento no qual o feudalismo esteve em formação. A partir do século XIV, iniciou-se a sua crise.\r\n\r\nAs regiões que presenciaram o feudalismo em sua aplicação clássica pertenciam à Europa Central, destacando-se a França, a Alemanha, o norte da Itália, e a Inglaterra. Outros locais, como Espanha e Portugal, também viveram algumas de suas características.\r\n\r\nOs historiadores consideram que o processo de consolidação do feudalismo estabeleceu-se com a fusão da cultura romana com a germânica. Um dos marcos desse momento foi o surgimento das relações de vassalagem no Império Carolíngio, durante o século VIII. Outros processos ainda estavam em curso, como a feudalização e a ruralização da Europa.\r\n\r\nA urbanização da Europa assim como o surgimento de outros ofícios, acontecimento que resultou em uma grande diversificação econômica, foram outros elementos que contribuíram para o fim dessa forma de organização. Econômica, social e politicamente a Europa transformou-se.\r\n\r\nÉ importante falar que o feudalismo dependia basicamente da exploração da terra. Sendo assim, enquanto sistema econômico, ele era atrelado ao trabalho agrícola e à exploração do trabalho dos camponeses. Esse quadro começo a delinear-se com a ruralização da Europa durante as invasões germânicas.\r\n\r\nPlebeus começaram a fugir das grandes cidades romanas e estabelecer-se junto às grandes propriedades rurais de romanos enriquecidos. Eles buscavam estar próximos a fontes de alimentos e garantir proteção. Para conseguir ambos, as pessoas aceitavam uma relação de servidão com o dono dessas propriedades.\r\n\r\nO dono da terra, conhecido como senhor feudal, permitia que camponeses se estabelecessem nela e exigia em troca que eles cultivassem o solo e lhe entregassem uma parte da produção. Isso se dava por meio de uma série de impostos cobrados dos camponeses. A obrigação do senhor feudal era a de garantir a proteção daqueles que estavam em suas terras. O camponês ficava ligado à terra e não poderia abandoná-la.\r\n\r\nNa questão ideológica, a Igreja Católica cumpria um papel importante naquela sociedade, uma vez que propagava a ideologia que justificava a organização social. Para a Igreja, cada grupo possuía uma função específica a ser realizada, e essas funções haviam sido estabelecidas por Deus. A Igreja, portanto, definia aquela sociedade como estamental, e isso resultava em pouca mobilidade social.\r\n\r\nAs três grandes classes eram:\r\n\r\nNobreza: formada pelos nobres, os donos das terras. A riqueza dessa classe colocava-os no papel de guerreiros e, portanto, defensores da cristandade.\r\nClero: formado pelo corpo da Igreja Católica. Cumpria as funções religiosas, e seus componentes consideravam-se os interlocutores de Deus na terra. Eram donos de muitas propriedades e riquezas.\r\nCamponeses: formados pela maioria, sobreviviam de seu próprio trabalho. Tinham obrigações a cumprir e, portanto, muitos impostos a pagar para nobres e clero.\r\nUma fala de um bispo francês, chamado Adalberon de Laon, é bastante conhecida e utilizada como exemplificação de como a Igreja enxergava os papéis de cada grupo na sociedade medieval. Segue o trecho:\r\n\r\nO domínio da fé é uno, mas há um triplo estatuto na Ordem. A lei humana impõe duas condições: o nobre e o servo não estão submetidos ao mesmo regime. Os guerreiros são protetores das igrejas. Eles defendem os poderosos e os fracos, protegem todo mundo, inclusive a si próprios. Os servos, por sua vez, têm outra condição. Esta raça de infelizes não tem nada sem sofrimento. Fornecer a todos alimentos e vestimenta: eia a função do servo. A casa de Deus, que parece una, é portanto tripla: uns rezam, outros combatem e outros trabalham. Todos os três formam um conjunto e não se separam: a obra de uns permite o trabalho dos outros dois e cada qual por sua vez presta seu apoio aos outros.\r\n\r\nEntre outras coisas.'),
(4, 'Idade Moderna', 'Ao pensar em modernidade, muitas pessoas logo imaginam que estamos fazendo referência aos acontecimentos, instituições e formas de agir presente no Mundo Contemporâneo. De fato, esse termo se transformou em palavra fácil para muitos daqueles que tentam definir em uma única palavra o mundo que vivemos. Contudo, não podemos pensar que esse contexto mais dinâmico e mutante surgiu do nada, que não possua uma historicidade.\r\n\r\nEntre os séculos XVI e XVIII, um volume extraordinário de transformações estabeleceu uma nova percepção de mundo, que ainda pulsa em nossos tempos. Encurtar distâncias, desvendar a natureza, lançar em mares nunca antes navegados foram apenas uma das poucas realizações que definem esse período histórico. De fato, as percepções do tempo e do espaço, antes tão extensas e progressivas, ganharam uma sensação mais intensa e volátil.\r\n\r\nO processo de formação das monarquias nacionais pode ser um dos mais interessantes exemplos que nos revela tal feição. Nesse curto espaço de quase quatro séculos, os reis europeus assistiram a consumação de seu poder hegemônico, bem como experimentaram as várias revoluções liberais defensoras da divisão do poder político e da ampliação dos meios de intervenção política. Tronos e parlamentos fizeram uma curiosa ciranda em apenas um piscar de olhos.\r\n\r\nAlém disso, se hoje tanto se fala em tecnologia e globalização, não podemos refutar a ligação intrínseca entre esses dois fenômenos e a Idade Moderna. O advento das Grandes Navegações, além de contribuir para o acúmulo de capitais na Europa, também foi importante para que a dinâmica de um comércio de natureza intercontinental viesse a acontecer. Com isso, as ações econômicas tomadas em um lugar passariam a repercutir em outras parcelas do planeta.\r\n\r\nNo século XVIII, o espírito investigativo dos cientistas e filósofos iluministas catapultou a busca pelo conhecimento em patamares nunca antes observados. Não por acaso, o desenvolvimento de novas máquinas e instrumentos desenvolveram em território britânico o advento da Revolução Industrial. Em pouco tempo, a mentalidade econômica de empresários, consumidores, operários e patrões fixaram mudanças que são sentidas até nos dias de hoje.\r\n\r\nEm um primeiro olhar, a Idade Moderna pode parecer um tanto confusa por conta da fluidez dos vários fatos históricos que se afixam e, logo em seguida, se reconfiguram. Apesar disso, dialogando com eventos mais específicos, é possível balizar as medidas que fazem essa ponte entre os tempos contemporâneo e moderno. Basta contar com um pouco do tempo... Aquele mesmo que parece ser tão volátil nesse instigante período histórico.\r\n\r\n'),
(5, 'Idade Contemporânea', 'Compreender o mundo contemporâneo do ponto de vista histórico é uma tarefa bastante complicada. Nesse período que se inicia no século XIX e vem até os dias de hoje, o historiador se depara com um fluxo de acontecimentos muito mais intenso do que em qualquer outro momento da História. De fato, tem-se a nítida impressão que a história começa a ficar mais acelerada e a função de refletir sobre os acontecimentos acaba ficando bastante complexa.\r\n\r\nUm primeiro fator que explica essa nova configuração tem a ver com o processo de urbanização que se espalha em várias partes do mundo. A concentração de pessoas promove uma ampla cadeia de inflexões na divulgação de informações, na produção de bens de consumo e no próprio ritmo de vida de cada indivíduo. As horas e os dias começam a ser unidades de tempo cada vez mais frágeis, seja em relação ao fluxo de coisas que acontecem ou sob as expectativas do homem para com o futuro.\r\n\r\nAlém disso, podemos também contabilizar um fator de ordem biológico bastante significativo. O avanço da medicina e o aprimoramento das condições de vida estabeleceram o prolongamento da nossa expectativa de vida. Com isso, o número de pessoas presentes no planeta se avolumou e, consequentemente, o desenvolvimento de ações históricas também sofreu um visível incremento. Isso sem levar em conta o avanço dos meios de comunicação que dinamizam a circulação de tais acontecimentos.\r\n\r\nO grande volume de fatos históricos a serem compreendidos na Idade Contemporânea acabou demonstrando um novo lugar para este campo do conhecimento. Com tantas transformações acontecendo, ficou cada vez mais nítido que a função de historiador não tem nada a ver com a elaboração de projeções para o futuro. A ciência histórica fica mais próxima de uma noção de que as formas de se ver o passado são atreladas aos valores do tempo presente.\r\n\r\nCom isso, mesmo com a modernização na fabricação e no armazenamento de informações, o estudo dos fatos contemporâneos não se mostra cristalizados ou presos aos grandes nomes, instituições e datas. O historiador ou o simples amante de História se transforma em um intérprete da cultura que vagueia pelo passado fundando outras possibilidades de compreendê-lo e, ao mesmo tempo, no modo de olhar o seu mundo. Sendo assim, como definimos a Idade Contemporânea? Apenas o tempo irá dizer.\r\n\r\n...');

