INSERT INTO `exercises_question` (`idexercises_question`, `question`, `question_group_idquestion_group`, `user_iduser`) VALUES
(1, '(UFG-2013) Leia as informações a seguir:\r\n\r\nEm meados do século XVIII, James Watt patenteou na Inglaterra seu invento, sobre o qual escreveu a seu pai: “O negócio a que me dedico agora se tornou um grande sucesso. A máquina de fogo que eu inventei está funcionando e obtendo uma resposta muito melhor do que qualquer outra que tenha sido inventada até agora”.\r\n\r\nDisponível em: http://www.ampltd.co.uk/digital_guides/ind-rev-series-3-parts-1-to-3/detailed-listing-part-1.aspx. Acesso em: 29 out. 2012.(Adaptado).', 1, 0),
(2, '(Aman-2015) O acúmulo de capitais, a modernização da agricultura, a disponibilidade de mão de obra e de recursos naturais e a força do puritanismo ajudam a explicar o pioneirismo da __________ na Revolução Industrial.\r\n\r\nBOULOS Jr, p.421', 1, 0),
(3, '(Fuvest) Sobre a inovação tecnológica no sistema fabril na Inglaterra do século XVIII, é correto afirmar que ela:', 1, 0),
(4, '(PUC-Campinas) Dentre as consequências sociais forjadas pela Revolução Industrial pode-se mencionar:', 1, 0),
(5, '(Fuvest-SP) Os primitivos habitantes do Brasil foram vítimas do processo colonizador. O europeu, com visão de mundo calcada em preconceitos, menosprezou o indígena e sua cultura. A acreditar nos viajantes e missionários, a partir de meados do século XVI, há um decréscimo da população indígena, que se agrava nos séculos seguintes. Os fatores que mais contribuíram para o citado decréscimo foram:', 3, 0),
(6, '(UFMG) Leia o texto.\r\n\r\n“A língua de que [os índios] usam, toda pela costa, é uma: ainda que em certos vocábulos difere em algumas partes; mas não de maneira que se deixem de entender. (...) Carece de três letras, convém a saber, não se acha nela F, nem L, nem R, coisa digna de espanto, porque assim não tem Fé, nem Lei, nem Rei, e desta maneira vivem desordenadamente (...).\"\r\n\r\n(GANDAVO, Pero de Magalhães, História da Província de Santa Cruz, 1578.)', 3, 0),
(7, '(Fuvest-SP) A sociedade colonial brasileira \"herdou concepções clássicas e medievais de organização e hierarquia, mas acrescentou-lhe sistemas de graduação que se originaram da diferenciação das ocupações, raça, cor e condição social. (...) as distinções essenciais entre fidalgos e plebeus tenderam a nivelar-se, pois o mar de indígenas que cercava os colonizadores portugueses tornava todo europeu, de fato, um gentil-homem em potencial. A disponibilidade de índios como escravos ou trabalhadores possibilitava aos imigrantes concretizar seus sonhos de nobreza. (...) Com índios, podia desfrutar de uma vida verdadeiramente nobre. O gentio transformou-se\r\n\r\nem um substituto do campesinato, um novo estado, que permitiu uma reorganização de categorias tradicionais. Contudo, o fato de serem aborígines e, mais tarde, os africanos, diferentes étnica, religiosa e fenotipicamente dos europeus, criou oportunidades para novas distinções e hierarquias baseadas na cultura e na cor.\"\r\n\r\n(Stuart B. Schwartz, Segredos internos.)', 3, 0),
(8, '(UFMG) Todas as alternativas apresentam fatores que explicam a primazia dos portugueses no cenário dos grandes descobrimentos, exceto', 3, 0),
(9, 'A Revolução Francesa iniciou-se em 1789 e estendeu-se até 1799, quando Napoleão Bonaparte assumiu o poder da França com o Golpe de 18 de Brumário. Esse acontecimento foi influenciado pelos ideais do:', 2, 0),
(10, 'Em 1789, o quadro da sociedade francesa era de intensa crise econômica e de grande convulsão social. O rei francês, como saída para a crise, optou por convocar os Estados Gerais. Selecione a alternativa que descreve corretamente do que se trata os Estados Gerais:', 2, 0),
(11, 'A Revolução Francesa estourou em 1789 e foi consequência de uma grande crise econômica e da intensa exploração que nobreza e clero exerciam sobre o povo. Quando o movimento iniciou-se, a ação do povo logo se voltou contra a nobreza e, em especial, contra o rei e seu estilo de vida luxuoso. O rei francês durante a revolução era:', 2, 0),
(12, 'Grande parte dos acontecimentos e das grandes decisões tomadas durante a Revolução Francesa foram realizados pelo povo, a massa formada principalmente de camponeses. Além do povo, outra classe que teve grande peso com o deflagrar da Revolução e sua condução foi:', 2, 0),
(40, 'Qual a capital da américa?', 1, 2);

