INSERT INTO `post` (`idpost`, `title`, `text`, `image`, `datetime`, `type_idtype`, `user_iduser`, `age_idperiodo`) VALUES
(1, 'Tumba inca com esqueletos de crianças sacrificadas é encontrada no Peru', 'Arqueólogos descobriram o túmulo de um nobre inca, situado no sítio arqueológico da Mata Índio em Lambayeque, no Peru, que tem mais de 500 anos. Acredita-se que ele tenha sido enterrado com seus companheiros, visto que foram encontrados esqueletos de cinco adultos e quatro crianças, que parecem ter sido sacrificadas.\r\n\r\nElas estavam debaixo do chão de pedra da sepultura, alinhadas de leste a oeste. Segundo o arqueólogo Alfredo Nunez, este é “um eixo simbólico muito importante para a época”. \r\n\r\nOs pesquisadores concluíram que a tumba provavelmente é de alguém importante, pois contém uma coleção de conchas marinhas de moluscos pertencentes ao gênero Spondylus, conhecidas como ostras espinhosas. Os incas costumavam enterrar nobres da sociedade com estes animais. \r\n\r\nA equipe também descobriu vasos, ainda que o túmulo tenha sido arrombado e saqueado várias vezes. A sepultura também tem uma estrutura interessante: inclui cavidades nas quais objetos simbólicos podem ser colocados. \"Temos a sorte de documentar a estrutura e recuperar alguns objetos\", disse Luis Chero Zurita, diretor do museu Huaca Rajada-Sipan, à agência de notícias local Andina.\r\n\r\nO túmulo cobre mais de 60 metros quadrados, o que é considerado grande para uma sepultura da área. \"É a primeira câmara funerária desta natureza e magnitude que é relatada em Lambayeque\", declarou o arqueólogo Anaximandro Nunez Mejia. “Foi construída a partir da escavação no solo de um poço com a profundidade e dimensões intencionalmente planejadas.\"\r\n\r\nFonte: https://revistagalileu.globo.com/Ciencia/Arqueologia/noticia/2019/02/tumba-inca-com-esqueletos-de-criancas-sacrificadas-e-encontrada-no-peru.html', NULL, '2020-09-10 20:56:42', 1, 3, 3);
INSERT INTO `post` (`idpost`, `title`, `text`, `image`, `datetime`, `type_idtype`, `user_iduser`, `age_idperiodo`) VALUES
(2, 'Arqueólogos encontram 20 sarcófagos do Antigo Egito', 'Vinte sarcófagos do Antigo Egito foram encontrados na cidade de Luxor, ao sul do país. A Necrópole de Asasif, localizada na antiga cidade de Tebas Ocidental, inclui túmulos que datam do Meio, Novo Reino e Últimos Períodos (1994 a.C. a 332 a.C.).\r\n\r\nEm uma breve declaração à imprensa, o Ministério de Antiguidades do Egito descreveu a descoberta como \"uma das maiores e mais importantes\" nos últimos anos. As autoridades também compartilharam fotos dos sarcófagos coloridos e decorados com inscrições e pinturas.\r\n\r\nAs autoridades disseram que mais informações serão anunciadas no próximo sábado (19 de outubro). O achado ocorreu pouco após a descoberta de uma \"zona industrial\" também nas proximidades de Luxor.\r\n\r\n', , '2020-09-10 20:56:59', 1, 3, 2);
INSERT INTO `post` (`idpost`, `title`, `text`, `image`, `datetime`, `type_idtype`, `user_iduser`, `age_idperiodo`) VALUES
(3, 'Encontrados possíveis destroços de navio comandado por James Cook', 'Uma equipe de arqueólogos acredita ter encontrado o navio Endeavour, do século 18, baía de Narragansett, em Rhode Island, nos Estados Unidos. Os destroços da embarcação são particularmente interessantes porque ela foi pilotada por James Cook, um dos maiores exploradores marítimos da história.\r\n\r\nO membro da Marinha Real comandou o Endeavour, um ex-transportador de carvão, em sua primeira viagem ao redor do mundo, entre 1768 e 1771. Sua primeira missão científica foi até o Taiti, onde Cook e sua equipe observaram o planeta Vênus passando em frente ao Sol.\r\n\r\nCook e o Endeavor também exploraram o Pacífico Sul e mapearam a costa da Nova Zelândia, antes de realizarem o primeiro desembarque europeu na Austrália, na Baía de Botany, em 1770. Juto com o capitão estavam Joseph Banks e outros oito cientistas, que registraram centenas de espécies vegetais e animais desconhecidos pelos europeus até então.\r\n\r\nApós a missão, o navio foi vendido a um proprietário particular que o renomeou como Lord Sandwich e tentou transportar soldados ingleses para a América durante a revolução que tomou conta do país à época. Entretanto, quando os franceses bloquearam a baía de Narragansett nos dias que antecederam a Batalha de Rhode Island, em 1778, a embarcação foi naufragada.\r\n\r\nO Projeto de Arqueologia Marinha de Rhode Island (RIMAP, na sigla em inglês) já tentava localizar a embarcação há uma década quando, em 2016, especialistas encontraram documentos históricos em Londres que confirmavam que o navio realmente havia afundado na foz da baía de Narragansett.\r\n\r\nAgora, uma nova pesquisa dos destroços afundados levou os autores a acreditarem que podem ter encontrado o navio. \"Tudo o que vimos neste ano é consistente com o Endeavour, e não vimos nada que indica que não seja ele\", disse a arqueóloga Kathy Abbass, da RIMAP, ao site Live Science.\r\n\r\nEntretanto, a identificação dos destroços depende de diversos outros fatores. \"Não achamos que vamos encontrar algo que diga \'Capitão Cook dormiu aqui\' — isso não é provável\", brincou a especialista. \"Mas se encontrarmos algumas das coisas menores que são consistentes com a forma como sabemos que a embarcação foi usada (...), então saberemos que a encontramos.\"\r\n\r\nOs mergulhadores da RIMAP continuarão explorando os destroços da embarcação, focando na construção do casco de madeira do navio e nos vestígios de seus usos posteriores, na esperança de confirmar sua identidade como o navio de Cook. \"Podemos ficar entusiasmados com o fato de as coisas parecerem promissoras, [mas] ainda não estamos dizendo que é o navio, apenas parece muito provável que possa ser\" afirmou Abbass.', '', '2020-09-10 20:57:22', 1, 3, 4);
INSERT INTO `post` (`idpost`, `title`, `text`, `image`, `datetime`, `type_idtype`, `user_iduser`, `age_idperiodo`) VALUES
(4, 'Cavalos machos eram os preferidos dos vikings, diz estudo', 'Os vikings que se estabeleceram na Islândia há mais de mil anos valorizavam tanto seus cavalos que os homens foram enterrados com seus equinos de confiança. Recentemente, uma nova pesquisa analisou o DNA de ossos de 19 desses animais e mostrou que os cavalos nos túmulos também eram machos.\r\n\r\nPublicado no periódico Journal of Archaeological Science, o estudo aponta que arqueólogos já encontraram 355 sepulturas vikings na Islândia, sendo que elas são datadas do final do século 9 até o início do século 11 d.C.. Os ocupantes são, em maioria, homens de meia-idade.\r\n\r\nEm 148 túmulos descobertos, já foram identificados 175 ossos de cavalos que aparentavam ter sido abatidos para o enterro. Para especialistas, isso sugere que os equinos machos eram importantes na cultura viking.\r\n\r\nLeia também:\r\n+ Arqueólogos encontram fósseis de gatos da época dos vikings\r\n+ Amuleto viking que retrata martelo de Thor é encontrado na Islândia\r\n\r\nSegundo Albina Hulda Pálsdóttir, aluna de doutorado do Centro de Síntese Evolutiva e Ecológica da Universidade de Oslo, na Noruega, a diferenciação dos ossos de cavalos machos e fêmeas ocorre por meio da análise da pélvis e dentes do animal. Contudo, essa avaliação só funciona se os restos mortais estiverem bem preservados\r\n\r\nNesta pesquisa, os cientistas usaram DNA antigo de pequenas quantidades de material genético para revelar o sexo dos cavalos. Eles examinaram 22 ossos de 17 locais, e dos 19 equinos encontrados em sepulturas, 18 eram machos.\r\n\r\n\"A proporção entre os sexos e a distribuição etária dos cavalos mortos sugere que havia uma estrutura bem formada por trás dos rituais, nos quais o cavalo escolhido atuava como representante simbólico\", explicou Pálsdóttir. \"A escolha consciente dos homens talvez estivesse ligada às características dos garanhões. A virilidade e a agressão poderiam ter sido um forte fator simbólico.”\r\n\r\nOs estudiosos ainda encontraram três ossos de águas do lado de fora das sepulturas que não receberam nenhum “tratamento especial” durante o enterro. Os arqueólogos pretendem comparar as amostras com ossos de cavalos encontrados no resto da Europa datados da Era Viking. A intenção é encontrar as origens geográficas dos animais, bem como suas características físicas.', , '2020-09-10 20:57:36', 1, 3, 3);
INSERT INTO `post` (`idpost`, `title`, `text`, `image`, `datetime`, `type_idtype`, `user_iduser`, `age_idperiodo`) VALUES
(5, 'Neandertais viraram canibais por conta de mudanças climáticas', 'Um estudo publicado recentemente por pesquisadores franceses no Journal of Archaeological Science afirma que um rápido período de aquecimento global ocorrido há 120 mil anos levou os neandertais a virarem canibalistas.\r\n\r\nO estudo, realizado pelos pesquisadores franceses Alban Defleur e Emmanuel Desclaux, acredita que a mudança climática teve impacto direto na guinada ao canibalismo desses hominídeos. Na década de 1990, os restos mortais de seis neandertais — dois adultos, dois adolescentes e duas crianças — foram encontrados em uma caverna em Baume Moula-Guercy, no sul da França.\r\n\r\nFoi com base nesses achados que os especialistas realizaram o estudo. Segundo eles, os restos mortais encontrados na caverna carregavam marcas de canibalismo, como o desmembramento completo dos indivíduos e parte dos ossos roídos por dentes humanos.\r\n\r\nLeia também:\r\n+ Arqueólogos afirmam que neandertais belgas eram canibais\r\n\r\nAo portal Gizmodo, Danielle Kurin, antropóloga da Universidade da Califórnia em Santa Bárbara, que não estava envolvida no novo estudo, acredita que “há evidências circunstanciais convincentes em toda a Europa de que os Neandertais ocasionalmente se envolveram com o canibalismo”.\r\n\r\nA descoberta que os neandertais tornaram-se canibais não é de hoje, porém, com o novo estudo, os especialistas esperam se aproximar das razões que levaram esses primatas a adotarem a prática. Até então, não há consenso entre os especialistas se o canibalismo foi uma prática ritualística, realizada em funerais, ou, se foi por uma questão de necessidade durante o período.\r\n\r\nDe acordo com o novo estudo, os pesquisadores acreditam que o \"canibalismo destacado em Baume Moula Guercy não é uma marca de bestialidade ou sub-humanidade\". Segundo os autores, os dados coletados por eles indicam que o episódio foi motivado pela sobrevivência dos primatas, que tentavam se adaptar às mudanças climáticas. ', NULL, '2020-09-10 20:57:43', 1, 3, 1);
INSERT INTO `post` (`idpost`, `title`, `text`, `image`, `datetime`, `type_idtype`, `user_iduser`, `age_idperiodo`) VALUES
(6, 'Alexandre, o Grande', 'Alexandre III Magno ou Alexandre, o Grande, rei da Macedônia, filho do imperador Fellipe II da Macedônia e  de Olímpia, princesa de Epiro, nasceu entre 20 e 30 de julho de 356 a .C, na região de Pella na Babilônia.\r\n\r\nAlexandre, conquistador do Império Persa, foi um dos mais importantes militares do mundo antigo.\r\n\r\nNa sua infância teve como tutor Aristóteles, que ensinou-lhe retórica e literatura, e estimulou seu interesse pelas ciências, medicina e filosofia.\r\n\r\nNo verão do ano 336 a.C., seu pai, Felipe II foi assassinado e Alexandre subiu ao trono da Macedônia, dando início à trajetória de um dos maiores conquistadores da História.\r\n\r\nAlexandre destacou-se pelo brilhantismo tático e pela rapidez com que atravessava grandes territórios. Ainda que valente e generoso, era cruel quando a situação política assim o exigia. Cometeu alguns atos dos quais se arrependeu, como o assassinato de seu amigo Clito em um momento de embriaguez. Como político e dirigente, teve planos grandiosos. Segundo alguns historiadores, elaborou um projeto de unificar o Oriente e o Ocidente em um império mundial.\r\n\r\nAcredita-se que cerca de 30 mil jovens persas foram educados na cultura grega e em táticas militares macedônicas, sendo aceitos no exército de Alexandre. Ele também adotou costumes persas e casou com mulheres orientais: Estatira ou Stateira, filha mais velha de Dario, e com Roxana, filha do sátrapa Bactriana Oxiartes. Além disso, subornou seus oficiais para que aceitassem mulheres persas como esposas.\r\n\r\nAlexandre ordenou que após sua morte,  as cidades gregas  lhe adorassem como um deus. Ainda que provavelmente tenha dado a ordem por razões políticas, segundo sua própria opinião e a de alguns contemporâneos, ele se considerava de origem divina.\r\n\r\nPara unificar suas conquistas, Alexandre fundou várias cidades ao longo de seus territórios, muitas das quais se chamaram Alexandria em sua homenagem. Essas cidades eram bem situadas, bem pavimentadas e contavam com bom serviço de abastecimento de água. Eram autônomas, mas sujeitas aos editos do rei. Os veteranos gregos de seu exército, bem como os soldados jovens, negociantes, comerciantes e eruditos, se instalaram nelas, levando consigo a cultura e a língua gregas. Assim, Alexandre estendeu amplamente a influência da civilização grega e preparou o caminho para os reinos do período helenístico e para a posterior expansão de Roma.\r\n\r\nEspeculações\r\nPor ter morrido ainda jovem e sem derrotas, muito se especula sobre o que teria acontecido se tivesse vivido mais tempo. Se tivesse conduzido suas forças numa invasão das terras a oeste do Mediterrâneo, provavelmente teria alcançado sucesso, e, nesse caso, toda a história da Europa ocidental poderia ser completamente diferente.\r\n\r\nCuriosidade\r\nEm 2004, o diretor de cinema Oliver Stone lançou o filme Alexandre, contando a biografia deste grande imperador da antiguidade.\r\n\r\n', , '2020-09-10 20:58:07', 2, 3, 2);
INSERT INTO `post` (`idpost`, `title`, `text`, `image`, `datetime`, `type_idtype`, `user_iduser`, `age_idperiodo`) VALUES
(7, 'Colonização do Brasil', 'Sempre que ouvimos falar da colonização portuguesa na América, lembramos logo da colonização do Brasil. Será que o Brasil foi realmente descoberto pelos portugueses? Ou o processo de colonização portuguesa foi uma conquista?\r\n\r\nA colonização portuguesa no Brasil teve como principais características: civilizar, exterminar, explorar, povoar, conquistar e dominar. Sabemos que os termos civilizar, explorar, exterminar, conquistar e dominar estão diretamente ligados às relações de poder de uma determinada civilização sobre outra, ou seja, os portugueses submetendo ao domínio e conquista os indígenas. Já os termos explorar, povoar remete-se à exploração e povoamento do novo território (América).\r\n\r\nA partir de então, já sabemos de uma coisa, que o Brasil não foi descoberto pelos portugueses, pois afirmando isto, estaremos negligenciando a história dos indígenas (povoadores) que viviam há muito tempo neste território antes da chegada dos europeus. Portanto, o processo de colonização portuguesa no Brasil teve um caráter semelhante a outras colonizações europeias, como, por exemplo, a espanhola: a conquista e o extermínio dos indígenas. Sendo assim, ressaltamos que o Brasil foi conquistado e não descoberto. \r\n\r\nA Coroa portuguesa, quando empreendeu o financiamento das navegações marítimas portuguesas no século XV, tinha como principal objetivo a expansão comercial e a busca de produtos para comercializar na Europa (obtenção do lucro), mas não podemos negligenciar outros motivos não menos importantes como a expansão do cristianismo (Catolicismo), o caráter aventureiro das navegações, a tentativa de superar os perigos do mar (perigos reais e imaginários) e a expansão territorial portuguesa (territórios além-mar).\r\n\r\nNo ano de 1500, os primeiros portugueses chegaram ao chamado “Novo Mundo” (América), e com eles o navegador Pedro Álvares Cabral desembarcou no litoral do novo território. Logo, os primeiros europeus tomaram posse das terras e tiveram os primeiros contatos com os indígenas denominados pelos portugueses de “selvagens”. Alguns historiadores chamaram o primeiro contato entre portugueses e indígenas de “encontro de culturas”, mas percebemos com o início do processo de colonização portuguesa um “desencontro de culturas”, começando então o extermínio dos indígenas tanto por meio dos conflitos entre os portugueses quanto pelas doenças trazidas pelos europeus, como a gripe e a sífilis.\r\n\r\nEntre 1500 a 1530, os portugueses efetivaram poucos empreendimentos no novo território conquistado, algumas expedições chegaram, como a de 1501, chefiada por Gaspar de Lemos e a expedição de Gonçalo Coelho de 1503, as principais realizações dessas expedições foram: nomear algumas localidades no litoral, confirmar a existência do pau-brasil e construir algumas feitorias.\r\n\r\nEm 1516, Dom Manuel I, rei de Portugal, enviou navios ao novo território para efetivar o povoamento e a exploração, instalaram-se em Porto Seguro, mas rapidamente foram expulsos pelos indígenas. Até o ano de 1530, a ocupação portuguesa ainda era bastante tímida, somente no ano de 1531, o monarca português Dom João III enviou Martin Afonso de Souza ao Brasil nomeado capitão-mor da esquadra e das terras coloniais, visando efetivar a exploração mineral e vegetal da região e a distribuição das sesmarias (lotes de terras).\r\n\r\nNo litoral do atual estado de São Paulo, Martin Afonso de Souza fundou no ano de 1532 os primeiros povoados do Brasil, as Vilas de São Vicente e Piratininga (atual cidade de São Paulo). No litoral paulista, o capitão-mor logo desenvolveu o plantio da cana-de-açúcar; os portugueses tiveram o contato com a cultura da cana-de-açúcar no período das cruzadas na Idade Média. \r\n\r\nAs primeiras experiências portuguesas de plantio e cultivo da cana-de-açúcar e o processamento do açúcar nos engenhos aconteceram primeiramente na Ilha da Madeira (situada no Oceano Atlântico, a 978 km a sudoeste de Lisboa, próximo ao litoral africano). Em razão da grande procura e do alto valor agregado a este produto na Europa, os portugueses levaram a cultura da cana-de-açúcar para o Brasil (em virtude da grande quantidade de terras, da fácil adaptação ao clima brasileiro e das novas técnicas de cultivo), desenvolvendo os primeiros engenhos no litoral paulista e no litoral do nordeste (atual estado de Pernambuco), a produção do açúcar se tornou um negócio rentável.\r\n\r\nPara desenvolver a produção do açúcar, os portugueses utilizaram nos engenhos a mão de obra escrava, os primeiros a serem escravizados foram os indígenas, posteriormente foi utilizada a mão de obra escrava africana, o tráfico negreiro neste período se tornou um atrativo empreendimento juntamente com os engenhos de açúcar.', NULL, '2020-09-10 20:58:15', 2, 3, 4),
(8, 'Abolição da escravatura', 'A abolição da escravatura foi um dos acontecimentos mais marcantes da história do Brasil e determinou o fim da escravização dos negros no Brasil. A abolição do trabalho escravo ocorreu por meio da Lei Áurea, aprovada no dia 13 de maio de 1888 com a assinatura da regente do Brasil, a princesa Isabel. A abolição da escravatura foi a conclusão de uma campanha popular que pressionou o Império para que a instituição da escravidão fosse abolida de nosso país.\r\n\r\nContexto histórico\r\nA abolição do trabalho escravo foi um assunto debatido em nosso país ao longo de todo o século XIX. Esse assunto já era discutido por algumas personalidades nos primeiros anos de nossa independência, como José Bonifácio, e se arrastou ao longo de todo o período monárquico. Mas o primeiro assunto que tomou real importância no cenário político de nosso país foi a proibição do tráfico negreiro.\r\n\r\nO tráfico existia no Brasil desde meados do século XVI, porém, no século XIX, os ingleses começaram a pressionar, primeiramente, Portugal e, em seguida, o Brasil para que o tráfico negreiro fosse proibido aqui. A pressão inglesa fez o Brasil assumir compromissos com a proibição do tráfico negreiro, na década de 1820.\r\n\r\nEsse compromisso resultou na Lei Feijó, de 1831, mas, mesmo assim, o tráfico negreiro continuou, desembarcando milhares de africanos todos os anos no Brasil. Em 1845, a Inglaterra, enfurecida com a postura permissiva do Brasil com o tráfico, decretou o Bill Aberdeen, lei que permitia às embarcações britânicas invadirem nossas águas territoriais para apreender os navios negreiros.\r\n\r\nO risco de uma guerra entre Brasil e Inglaterra por conta do Bill Aberdeen fez com que fosse aprovada uma lei, em 1850, conhecida como Lei Eusébio de Queirós. Essa lei decretava a proibição definitiva sobre o tráfico negreiro no Brasil, mas permitia que os africanos que chegaram após a lei de 1831 continuassem como escravos. Com essa lei, a repressão ao tráfico negreiro foi efetiva e, de 1851 até 1856, “somente” 6900 africanos chegaram ao Brasil|1|.\r\n\r\nCom a proibição do tráfico, foi iniciado um processo de transição, pois, uma vez que a fonte que renovava os números de escravos no Brasil tinha acabado, era natural que com o tempo a escravidão no país fosse abolida, já que não havia a renovação natural da população de escravos no país. A intenção dos escravocratas era tornar essa transição a mais longa possível.\r\n\r\nNa década de 1860, a pressão sobre o Império pelo fim da escravidão era enorme, porque a Rússia havia acabado com a servidão em seu território e os Estados Unidos havia abolido a escravidão depois da Guerra Civil. Isso tornava o Brasil, Porto Rico e Cuba os últimos locais escravocratas do continente americano.\r\n\r\nNesse contexto, o movimento abolicionista começou a se estruturar, mas, politicamente, a pauta não avançava por conta da Guerra do Paraguai. Com o fim do conflito, em 1870, os movimentos abolicionistas ganharam força e o debate pelo fim da escravidão além de tornar-se pauta importante na política, também tornou-se um debate relevante na sociedade brasileira.\r\n\r\nAcesse também: Conheça a trajetória de três importantes abolicionistas negros do Brasil\r\n\r\nMovimento abolicionista\r\nA abolição da escravatura no Brasil não foi resultado da benevolência do Império, como muitos acreditam. Essa conquista foi resultado do engajamento popular contra essa instituição, e a pressão popular sobre o Império foi o fator que fez com que a escravidão fosse abolida em 13 de maio de 1888.\r\n\r\nConforme o movimento abolicionista ganhava força, os grupos escravocratas articulavam-se politicamente para barrar o avanço do abolicionismo. O debate no campo político encaminhou a aprovação de uma lei, em 1871, conhecida como Lei do Ventre Livre.\r\n\r\nEssa lei declarava que todo nascido de escrava, a partir de 1871, seria declarado livre, mas desde que prestasse um tempo de serviço, sendo libertado com oito anos (com indenização) ou com vinte e um anos (sem indenização).\r\n\r\nEssa lei foi decretada para atender uma série de interesses dos donos de escravos, mas foi utilizada frequentemente por advogados e rábulas (advogado sem formação acadêmica) abolicionistas na defesa dos escravizados. Essa atuação na lei foi uma das formas de resistência popular contra a instituição da escravidão em nosso país. Outra lei criada pelos escravocratas para atender seus interesses de transição gradual foi a Lei dos Sexagenários, de 1885.\r\n\r\nA mobilização abolicionista, por sua vez, não ficou reclusa a isso. Entre 1868 e 1871, surgiram 25 associações que defendiam a abolição em diferentes províncias do Brasil|2|. Um dos nomes que já estava envolvido com essas associações foi Luís Gama, advogado negro que atuou arduamente na defesa da abolição.\r\n\r\nO crescimento da causa abolicionista aconteceu a partir da década de 1870, mas, na década de 1880, esse foi o assunto mais debatido do país. O crescimento do abolicionismo é expresso no dado que aponta que, entre 1878 e 1885, surgiram 227 associações abolicionistas no país|3|. Essa quantidade de associações contribuiu para espalhar a causa publicamente e fez com que as classes populares do país começassem a defender o abolicionismo.\r\n\r\nEntre essas associações, a maior e mais importante delas foi a Confederação Abolicionista, associação criada por André Rebouças e José do Patrocínio. A historiadora Ângela Alonso alega que a Confederação Abolicionista “coordenou a propaganda em escala nacional, agrupando associações e desencadeando a campanha de libertação”|4|.\r\n\r\nA resistência contra a escravidão também ocorreu nas vias “ilegais” (pela legislação da época) e era comum que pessoas abrigassem escravos fugidos e que essas associações abolicionistas organizassem movimentos que roubavam escravos de seus donos e os levavam para o Ceará (local onde a abolição aconteceu em 1884). Caso tenha interesse em saber mais sobre isso, sugerimos a leitura deste texto: Caifazes e o abolicionismo popular.\r\n\r\nEsses grupos abolicionistas criavam rotas de fuga para os escravos, divulgavam panfletos, publicavam textos em defesa da causa em jornais, organizavam conferências e eventos públicos, forjavam papeis de alforria etc. Grupos intelectualizados, como escritores, advogados e jornalistas aderiram à causa, mas também grupos populares, como associações de trabalhadores.\r\n\r\nA movimentação contra a escravidão não aconteceu apenas pela população livre do Brasil, mas contou com o envolvimento fundamental dos escravos. Segundo o historiador João José Reis|5|, a ação dos escravos foi fundamental, pois impôs os limites aos senhores de escravos e contribuiu abertamente para a abolição da escravatura em 1888.\r\n\r\nDurante todo o século XVIII, mas, principalmente a partir da década de 1870, os escravos organizaram-se e rebelaram-se contra a escravidão. Entre as formas de resistência estão as fugas que poderiam ser individuais ou coletivas, as revoltas que exigiam melhorias no seu trato e havia revoltas que resultavam na morte dos senhores de escravos.\r\n\r\nOs escravos que fugiam abrigavam-se em quilombos que, na segunda metade do século XIX, se espalharam pelo país, sobretudo em regiões como Santos e o Rio de Janeiro. Em um desses quilombos – o Quilombo do Leblon – surgiu o símbolo do movimento abolicionista na década de 1870 e 1880: a camélia branca.\r\n\r\nNesse quilombo, os escravos cultivavam camélias brancas para vender e, com o tempo, essa flor tornou-se símbolo da causa. Isso foi resultado da propaganda abolicionista e, segundo as historiadoras Lilia Schwarcz e Heloísa Starling afirmaram, “portar uma camélia na botoeira do paletó ou cultivá-la no jardim de casa era gesto político”|6|. Esse gesto demonstrava que a pessoa apoiava a causa abolicionista.\r\n\r\nA adesão de diferentes grupos ao abolicionismo fez com que a causa ganhasse força em nível nacional. Essa ação, como percebemos, mobilizou os próprios escravos, contou com a adesão de diferentes grupos da sociedade e tomou espaço no debate político. Em 1887, a situação era insustentável: as revoltas de escravos espalhavam-se pelo país e as autoridades não conseguiam mais controlá-las.\r\n\r\nOs abolicionistas chegaram até a convocar a população às armas para defender a causa abolicionista, e, no começo de 1888, parte dos grupos políticos que defendiam a escravidão acabaram aderindo à causa abolicionista. O projeto pela abolição foi proposto pelo político do Partido Conservador João Alfredo, e, após ser aprovada pelo Senado, foi levada para que a regente do Brasil, a princesa Isabel assinasse a Lei Áurea, em 13 de maio de 1888.\r\n\r\nCom a aprovação da Lei Áurea, a festa do povo espalhou-se pelas ruas do Rio de Janeiro e foi estendida por dias. As festas populares não aconteceram somente no Rio de Janeiro, mas espalharam-se pelo país e ocorreram em locais como Recife e Rio de Janeiro e em zonas rurais do país.', NULL, '2020-09-10 20:58:34', 2, 3, 5),
(9, 'Segunda Guerra Mundial\r\n', 'A Segunda Guerra Mundial foi o maior conflito da humanidade, acontecendo de 1939 a 1945, em diferentes locais da Oceania, Ásia, África e Europa. Esse conflito foi travado entre Aliados (Reino Unido, França, EUA, URSS etc.) e Eixo (Itália, Alemanha, Japão etc.) e teve como consequências a morte de, aproximadamente, 60 milhões de pessoas e uma destruição material significativa.\r\n\r\nA Segunda Guerra Mundial teve como causa direta o expansionismo da Alemanha nazista ao longo da década de 1930. O estopim para o conflito deu-se com a invasão da Polônia realizada pelos alemães, em setembro de 1939. A Segunda Guerra Mundial ficou marcada pelos horrores do Holocausto e do lançamento das bombas atômicas.\r\n\r\nCausas\r\nA Segunda Guerra Mundial está relacionada com a expansão do totalitarismo na Europa e teve como causa direta o expansionismo germânico naquele período. Além disso, a derrota na Primeira Guerra tornou-se fonte de humilhação e causa de uma grave crise econômica que atingiu a Alemanha na década de 1920.\r\n\r\nEsse cenário permitiu a ascensão do radicalismo da extrema-direita, cujo expoente máximo foi o nazismo. Os nazistas criticavam os termos do Tratado de Versalhes, defendiam a militarização da Alemanha e tinham opiniões abertamente antissemitas. O crescimento dos nazistas durante a República de Weimar (1919-1933) foi exponencial, muito por conta de Adolf Hitler.\r\n\r\nOs nazistas, por fim, assumiram o poder na Alemanha, em 1933, e iniciaram a construção de um governo totalitário. Progressivamente, eles procuraram recuperar a economia alemã e reorganizar o exército alemão (desestruturado desde a Primeira Guerra). Uma vez que as forças militares alemãs eram fortes o bastante, deu-se início à expansão territorial.\r\n\r\nA expansão territorial defendida pelos alemães fazia parte de um elemento da ideologia nazista que defendia a formação de um “espaço vital” que abrigaria os arianos. A prosperidade dos alemães seria garantida por meio da exploração de povos enxergados como “inferiores”, como os eslavos.\r\n\r\nNo final da década de 1930, os alemães voltaram-se, a princípio, contra a Áustria, nação historicamente de idioma e cultura alemãs. Planos de unificação da Alemanha e Áustria tinham sido ventilados após a Primeira Guerra, mas foram barrados durante as negociações que levaram à assinatura do Tratado de Versalhes.\r\n\r\nAcesse também: Saiba como se deu a participação brasileira na Segunda Guerra Mundial\r\n\r\nEm 1938, os alemães iniciaram uma campanha maciça para garantir a unificação dos dois países. Isso se concretizou em março de 1938, em um evento conhecido como Anschluss. Depois, os alemães voltaram-se contra a Checoslováquia, por conta de uma região daquele país chamada Sudetos.\r\n\r\nAs exigências alemãs sobre os Sudetos alarmaram ingleses e franceses, e a tensão diplomática na Europa aumentou. Para contornar essa situação, foi organizada a Conferência de Munique, em 1938. Nessa conferência, ingleses e franceses, temerosos de que uma guerra fosse iniciada, cederam às pressões alemãs e permitiram que os alemães invadissem o território da Checoslováquia.\r\n\r\nUm ponto importante da Conferência de Munique é que ingleses e franceses demandaram de Hitler o compromisso de que a Checoslováquia seria a última exigência territorial da Alemanha. Hitler firmou esse acordo, mas estava blefando. Ele não acreditava que ingleses e franceses teriam coragem de declarar guerra aos alemães.\r\n\r\nAssim, em 1939, Hitler colocou seu olhos sobre a Polônia. À medida que a tensão entre Alemanha e Polônia aumentava, ingleses e franceses assinaram acordos militares com o segundo país para resguardá-lo, em caso de agressão do primeiro. Como Hitler não acreditava na resposta francesa e inglesa, ele ordenou o ataque contra a Polônia em 1º de setembro de 1939.\r\n\r\nEsse ato de agressão foi considerado o estopim da Segunda Guerra, pois, dias depois, Reino Unido e França declararam guerra à Alemanha.\r\n\r\n\r\nPaíses participantes\r\nA Segunda Guerra Mundial teve dezenas de nações participantes, com graus diferentes de envolvimento no esforço bélico. Esse conflito foi lutado por nações do Eixo contra as nações Aliadas, sendo:\r\n\r\nAliados: Reino Unido, França, EUA e URSS (principais forças);\r\nEixo: Alemanha, Itália e Japão (principais forças).\r\n\r\nFases da guerra\r\nA Segunda Guerra Mundial estendeu-se por seis anos e alcançou um nível de mobilização chamado pelos historiadores de guerra total. Esses anos podem ser divididos em três fases, que são:\r\n\r\n1ª fase (1939-1941): ficou marcada pela supremacia das forças alemãs e japonesas no conflito. Os alemães, por meio da blitzkrieg, conseguiram conquistar uma série de nações europeias. Os japoneses, por sua vez, iniciaram sua expansão pelo sudeste asiático, conquistando as colônias de britânicos, franceses e holandeses. Além disso, os japoneses realizaram um ataque que causou grande prejuízo aos norte-americanos, em Pearl Harbor.\r\n2ª fase (1942-1943): é o momento em que o quadro da Segunda Guerra começou a inverter-se. Os alemães foram barrados pelos soviéticos na famosa Batalha de Stalingrado, e o poder de guerra dos alemães iniciou seu declínio. O mesmo aconteceu com os japoneses, que, após a derrota na Batalha de Midway, perderam parte considerável do seu poder de guerra e foram sendo derrotados lentamente pelos norte-americanos.\r\n3ª fase (1944-1945): momento em que os membros do Eixo são derrotados. As forças dos Aliados na Europa cercaram os alemães e conduziram a invasão do território germânico na virada de 1944 para 1945. Os japoneses passaram a sofrer cada vez mais com os bombardeios dos EUA. Internamente o país estava em colapso, mas a recusa dos japoneses em renderem-se levou os americanos a atingirem o Japão com duas bombas atômicas. A derrota do Eixo trouxe o fim à guerra.\r\n\r\nMomentos marcantes\r\nA Segunda Guerra Mundial foi um conflito extenso, marcado por uma infinidade de acontecimentos e muitas reviravoltas. Como mencionado, a guerra iniciou-se com a invasão da Polônia, em setembro de 1939. O território polonês foi conquistado pelos germânicos em poucas semanas e foi dividido entre alemães e soviéticos por conta de uma cláusula do Tratado de Não-Agressão. Vejamos os principais acontecimentos.\r\n\r\nBlitzkrieg\r\nDe 1939 a 1940, houve um período de pouca ação conhecido como Guerra de Mentira. A partir de 1940, os alemães iniciaram suas ofensivas pela Europa e conquistaram Noruega, Dinamarca, Bélgica, Holanda, França, Iugoslávia, Grécia etc. As grandes conquistas alemãs deixaram o Alto Comando nazista entusiasmado com a capacidade de guerra do país.\r\n\r\nEsses avanços só foram possíveis por causa da blitzkrieg, uma tática de guerra inovadora para a época e que coordenava ataques múltiplos de diversas forças do exército alemão. Movido pelo sucesso da blitzkrieg, Adolf Hitler ordenou a realização de um ataque contra a União Soviética. Esse acontecimento mudou o destino da Segunda Guerra Mundial.\r\n\r\nInvasão da União Soviética\r\nA Operação Barbarossa foi iniciada pelos alemães em 22 de junho de 1941 e mobilizou mais de três milhões de soldados, além de milhares de aviões, tanques e peças de artilharia. O ataque iniciou-se baseado na tática da blitzkrieg e possibilitou rápidos avanços para os alemães. O objetivo era conquistar a União Soviética em até oito semanas.\r\n\r\nAos poucos, o esforço de guerra dos soviéticos e a falta de recursos da Alemanha para lutar em duas frentes de guerra foram determinantes para a interrupção do avanço germânico. No final de 1941, os alemães possuíam três grandes alvos a serem conquistados na URSS.\r\n\r\nEsses alvos eram:\r\n\r\nLeningrado, cidade que os alemães planejaram conquistar deixando a população morrer de fome. Somente em 1944 é que o cerco alemão contra Leningrado foi quebrado;\r\nMoscou, a capital soviética. Os alemães chegaram aos arredores de Moscou e ficaram a menos de 30 km do Kremlin, mas o enfraquecimento das suas forças repeliram-nos dos arredores da cidade;\r\nStalingrado, cidade ao sul da URSS. Os alemães tentaram conquistá-la como forma de controlar o Cáucaso e, assim, garantir-lhes recursos importantes, como petróleo. A divisão das forças alemãs e a resistência obstinada conduziram-nos à derrota na maior batalha da Segunda Guerra. Estima-se que o número de mortos em Stalingrado foi de dois milhões de pessoas.\r\nA derrota em Stalingrado enfraqueceu consideravelmente a Alemanha. A quantidade de recursos disponíveis para o país foi reduzida drasticamente e a sua capacidade industrial caiu. Basicamente, os alemães não tinham condições materiais e financeiras de suportar o esforço que a guerra na URSS demandava, e eles sabiam disso desde o final de 1941.\r\n\r\nDerrota da Alemanha\r\nHouve derrotas significativas sofridas pelos alemães no território soviético após Stalingrado. O maior destaque, nesse sentido, é Kursk, batalha fundamental para os alemães que terminou com a derrota deles porque foram obrigados a recuar a fim de reforçarem suas linhas na Itália. Os alemães tinham sido expulsos do norte da África, e, com isso, a Itália passou a ser invadida pelo sul.\r\n\r\nEles perderam o controle sobre a Itália, reconquistada pelos Aliados. O líder do fascismo italiano, Mussolini, foi morto por guerrilheiros que lutavam contra os nazistas. No leste europeu, os alemães foram empurrados por milhões de soldados soviéticos. Locais como Estônia, Polônia, Hungria, entre outros, foram reconquistados à medida que as forças soviéticas avançavam.\r\n\r\nO Dia D, realizado em 6 junho de 1944, abriu uma nova frente de guerra dos Aliados contra os nazistas e aumentou a pressão sobre os alemães. Em 1945, os Aliados entraram em território alemão, e Berlim, a capital do país, foi conquistada em abril. Adolf Hitler cometeu suicídio e, em maio de 1945, a Alemanha rendeu-se.\r\n\r\nAcesse também: Os principais acontecimentos que marcaram a Segunda Guerra na Ásia\r\n\r\nDerrota do Japão\r\nA derrota do Japão aconteceu oficialmente em setembro de 1945. A luta contra os americanos tinha sido iniciada em dezembro de 1941, quando os japoneses atacaram a base naval dos Estados Unidos, em Pearl Harbor, no Havaí. A supremacia dos japoneses sobre os norte-americanos na Guerra do Pacífico durou pouco: em junho de 1942, o poderio japonês foi severamente prejudicado.\r\n\r\nNesse mês aconteceu a Batalha de Midway, importante ataque aeronaval que resultou na destruição de quatro porta-aviões da marinha japonesa. Depois disso, os japoneses nunca mais conseguiram recuperar seu poderio na luta contra os EUA. Pouco a pouco, aqueles acumularam derrotas e foram empurrados de volta para o seu território.\r\n\r\nOs japoneses sofreram em inúmeras batalhas, como em Guadalcanal, nas Filipinas, em Okinawa etc. Em 1945, os norte-americanos fizeram bombardeios maciços sobre as principais cidades japonesas. O último passo deles era invadir a ilha principal do Japão, mas, para evitar isso, eles fizeram uso de uma arma cruel.\r\n\r\nDuas bombas atômicas foram lançadas, uma sobre Hiroshima e outra sobre Nagasaki, nos dias 6 e 9 de agosto, respectivamente. O lançamento não foi suficiente para convencer membros do governo japonês a oferecerem rendição. A invasão da Manchúria por tropas soviéticas, a partir de 9 de agosto, foi a pá de cal sobre o governo japonês. Em 2 de setembro de 1945, os japoneses assinaram a rendição e colocaram fim na Segunda Guerra Mundial.\r\n\r\n', NULL, '2020-09-10 20:58:42', 2, 3, 5),
(10, 'Mesopotâmia e os povos mesopotâmicos', 'A Mesopotâmia abrigou parte das primeiras civilizações da humanidade. A presença em sua região dos rios Tigre e Eufrates foi fundamental para que o homem, a partir do desenvolvimento da agricultura e da criação de animais, pudesse sedentarizar-se e formar cidades naquele local. Diversos povos habitaram a Mesopotâmia durante a Antiguidade, entre eles, destacam-se os sumérios, amoritas, assírios e caldeus.\r\n\r\nMesopotâmia\r\n\r\nA Mesopotâmia pertencia a uma região localizada no Oriente Médio (predominantemente no atual Iraque) entre dois importantes rios: Tigre e Eufrates. Suas condições naturais, principalmente por causa da fertilidade do solo, permitiram que pequenas aldeias fossem formadas em seu território.\r\n\r\nA fertilidade do solo era garantida pelo ciclo de cheias dos dois rios que encharcavam o solo com material orgânico e permitia o desenvolvimento da agricultura e da criação de animais. A palavra “Mesopotâmia” tem origem no idioma grego e significa “terra entre rios” em uma menção direta à importância dos rios para aquela região.\r\n\r\nOs primeiros povos que se estabeleceram na região de maneira sedentária foram os sumérios. As primeiras cidades da Mesopotâmia foram fundadas por eles e acredita-se que os sumérios tenham chegado ao local por volta de 5000 a.C. Algumas das importantes cidades construídas pelos sumérios foram Ur, Uruk e Nipur. As cidades sumérias eram consideradas cidades-estado, ou seja, possuíam organização independente uma das outras.\r\n\r\nOs sumérios foram extremamente importantes para o desenvolvimento humano, pois, ali, desenvolveram técnicas para importantes construções que permitiam ao homem manter um controle sobre a natureza. Esse povo desenvolveu barragens para impedir o avanço das águas dos rios no período de cheias, além de reservatórios e canais de irrigação.\r\n\r\nAlém disso, atribui-se aos sumérios o desenvolvimento da primeira forma de escrita da humanidade: a escrita cuneiforme. Criada para manter controle sobre a contabilidade dos palácios reais, essa escrita era feita em blocos de argila com um instrumento pontiagudo chamado cunha.\r\n\r\nO domínio dos sumérios na Mesopotâmia encerrou-se com a chegada dos acádios, que conquistaram as cidades da região e fundaram o Império Acádio. Eles tiveram como principal rei Sargão I, ou Sargão da Acádia. No entanto, o império dos acádios foi muito breve e logo foi substituído pelos amoritas como povo predominante na Mesopotâmia.\r\n\r\nOs amoritas, também conhecidos como babilônios, instalaram-se na região por volta de 2000 a.C., ocuparam a cidade da Babilônia e transformaram-na em um grande centro urbano e comercial da Mesopotâmia. Os historiadores afirmam que importantes rotas comerciais passavam pela cidade e que comerciantes chegavam de diferentes partes do mundo antigo.\r\n\r\nO estabelecimento amorita na Babilônia levou à formação do Primeiro Império Babilônico. Os amoritas sofreram forte influência dos sumérios e tiveram como rei mais importante Hamurábi, responsável pelo desenvolvimento de um código agrupando antigas leis mesopotâmicas que ficou conhecido Código de Hamurábi.\r\n\r\nEsse códico baseava-se em um princípio conhecido como Lei de Talião, o qual tem como lema “olho por olho, dente por dente”, ou seja, aquele que cometesse um delito tinha como pena uma punição proporcional ao dano que havia causado. O Código de Hamurábi foi antecedido por outros conjuntos de leis na Mesopotâmia, como o Código de Ur Nammu.\r\n\r\nO reino dos amoritas enfraqueceu-se depois da morte de Hamurábi e foi sucedido, tempos depois, pelos assírios. Os assírios formaram uma sociedade extremamente militarizada a partir do final do segundo milênio a.C. e iniciaram um processo de expansão e conquista na Mesopotâmia por volta de 1200 a.C. Eles conquistaram toda a Mesopotâmia, além da Palestina, do Egito e parte da Pérsia.\r\n\r\nOs assírios ficaram célebres por terem sido guerreiros temíveis que se utilizavam de técnicas violentas em combate e por tratarem seus prisioneiros com extrema brutalidade. Os povos conquistados, além de serem governados de maneira tirânica, eram obrigados a pagar pesados tributos. A violência dos assírios foi levantada pelos historiadores como o motivo que deu início a inúmeras revoltas que enfraqueceram o poder dos assírios por volta do século VII a.C.\r\n\r\nO rei mais importante dos assírios foi Assurbanipal, que ficou conhecido por ser um apreciador da erudição e por mandar construir a Biblioteca de Nínive (principal cidade da Assíria). Essa biblioteca reunia milhares de textos em escrita cuneiforme sobre diversos assuntos, e grande parte do que se conhece sobre a Mesopotâmia hoje é por causa da Biblioteca de Nínive.\r\n\r\nPor fim, o enfraquecimento dos assírios permitiu aos caldeus conquistar a Mesopotâmia e fundar o Segundo Império Babilônico em 612 a.C. O império formado por esse povo foi breve e teve com o principal rei Nabucodonosor, responsável por reconquistar a Palestina e toda a Mesopotâmia. Atribui-se a esse rei a construção dos Jardins Suspensos da Babilônia, considerado uma das maravilhas do mundo antigo.\r\n\r\nO império dos caldeus foi o último desenvolvido por um povo mesopotâmico. Seu domínio foi enfraquecido após a morte de Nabucodonosor e, por isso, eles foram conquistados pelos persas, liderados por Ciro II em 539 a.C. Os persas eram um povo originário da Pérsia, região do atual Irã.', NULL, '2020-09-10 20:58:51', 2, 3, 2),
(11, 'Revolução Francesa', 'A Revolução Francesa, que ocorreu no ano de 1789, é o evento que, segundo alguns autores, inaugura a chamada Idade Contemporânea. Os historiadores do século XIX, que fizeram a linha divisória da História, imputaram a este acontecimento o caráter de marco divisor entre a Idade Moderna e a Contemporânea, por conta da radicalização política que o caracterizou. Para se entender a Revolução Francesa é necessário conhecer um pouco da situação econômica e social da França do século XVIII.\r\n\r\nAté o século XVIII, a França era um estado em que vigia o modelo do absolutismo monárquico. O então rei francês, Luís XVI, personificava o Estado, reunindo em sua pessoa os poderes legislativo, executivo e judiciário. Os franceses então não eram cidadãos de um Estado Democrático Constitucional, como hoje é comum em todo o mundo ocidental, mas eram súditos do rei. O rei personificava o Estado.\r\n\r\nDentro da estrutura do Estado Absolutista, havia três diferentes estados nos quais a população se enquadrava: o primeiro estado era representado pelos bispos do Alto Clero; o segundo estado tinha como representantes a nobreza, ou a aristocracia francesa – que desempenhava funções militares (nobreza de espada) ou funções jurídicas (nobreza de toga); o terceiro estado, por sua vez, era representado pela burguesia, que se dividia entre membros do Baixo Clero, comerciantes, banqueiros, empresários, os sans-cullotes (“sem calções”), trabalhadores urbanos, e os camponeses, totalizando cerca de 97% da população.\r\n\r\nAo logo da segunda metade do século XVIII, a França se envolveu em inúmeras guerras, como a Guerra do Sete Anos (1756-1763), contra a Inglaterra, e o auxílio dado aos Estados Unidos na Guerra de Independência (1776). Ao mesmo tempo, a Corte absolutista francesa, que possuía um alto custo de vida, era financiada pelo estado, que, por sua vez, já gastava bastante seu orçamento com a burocracia que o mantinha em funcionamento. Soma-se a essa atmosfera duas crises que a França teria que enfrentar: 1) uma crise no campo, em razão das péssimas colheitas das décadas de 1770 e 1780, o que gerou uma inflação 62%; e 2) uma crise financeira, derivada da dívida pública que se acumulava, sobretudo pela falta de modernização econômica – principalmente a falta de investimento no setor industrial.\r\n\r\nOs membros do terceiro estado (muitos deles influenciados pelo pensamento iluminista e pelos panfletos que propagavam as ideias de liberdade e igualdade, disseminados entre a população) passaram a ser os mais afetados pela crise. No fim da década de 1780, a burguesia, os trabalhadores urbanos e os camponeses começaram a exigir uma resposta do rei e da Corte à crise que os afetava, bem como passaram a reivindicar direitos mais amplos e maior representação dentro da estrutura política francesa. Em julho de 1788, houve a convocação dos Estados Gerais, isto é, uma reunião para deliberação sobre assuntos relacionados à situação política da França. Nessa convocação, o conflito entre os interesses do terceiro estado e os da nobreza e do Alto Clero, que apoiavam o rei, se acirraram. O rei então estabeleceu a Assembleia dos Estados Gerais em 5 de maio de 1789, com o objetivo de decidir pelo voto os rumos do país. Entretanto, os votos eram por representação de estado. Sendo assim, sempre o resultado seria dois votos contra um, ou seja: primeiro e segundo estados contra o terceiro. Fato que despertou a indignação de burgueses e trabalhadores.\r\n\r\nA burguesia, que liderava o terceiro estado, propôs em 10 de junho uma Assembleia Nacional, isto é, uma assembleia para se formular uma nova constituição para a França. Essa proposta não obteve resposta por parte do rei, da nobreza e do Alto Clero. Em 17 de junho, burgueses, trabalhadores e demais membros do terceiro estado se declararam em reunião para formulação de uma constituição, mesmo sem a resposta do primeiro e do segundo estado. Ao mesmo tempo, começava um levante popular em Paris e outro entre os camponeses. A Revolução se iniciou.\r\n\r\nEm 14 de julho de 1789, a massa de populares tomou a Bastilha, a prisão que era símbolo do Antigo Regime e, em 4 de agosto, a Assembleia Nacional instituiu uma série de decretos que, dentre outras coisas, cortava os privilégios da nobreza, como a isenção de impostos e o monopólio sobre terras cultiváveis. A Assembleia institui a Declaração de Direitos do Homem e do Cidadão, que reivindicava a condição de cidadãos aos franceses e não mais de súditos do rei. Em setembro de 1791 foi promulgada a nova constituição francesa, assegurando a cidadania para todos e pressionando o monarca Luís XVI a aceitar os seus critérios. Essa constituição previa ainda a igualdade de todos perante a lei, o voto censitário, a confiscação das terras eclesiásticas, o fim do dízimo, a constituição civil do clero, detre outros pontos. A partir deste momento, a França revolucionária esboçou o seu primeiro tipo de novo governo, a Monarquia Constitucional, que durou de 1791 a 1792.\r\n\r\nA ala mais radical da Revolução, os jacobinos (que haviam participado da Assembleia Constituinte, sentando-se à esquerda do plenário e opondo-se aos girondinos que se posicionavam à direita), defendiam uma ampliação da perspectiva revolucionária, cuja proposta era não se submeter às decisões da alta burguesia, que se articulava com a nobreza e o monarca. Os jacobinos queriam radicalizar a pressão contra os nobres e o clero, e instituir uma República Revolucionária, sem nenhum resquício da Monarquia.\r\n\r\nPrevendo a ameaça que vinha dos rumos que a Revolução tomava, o rei Luís XVI articulou um levante contrarrevolucionário com o apoio das monarquia austríaca e prussiana. Em 1792, a Áustria invadiu a França e essa declarou guerra àquela. A população parisiense, após saber dos planos do rei, invadiu o palácio real de Tulleries e prendeu o rei e sua família. O Rei e sua esposa, Maria Antonieta, tiveram suas cabeças decepadas pela guilhotina em 1793 e a Monarquia Constitucional chegou ao seu fim no mesmo ano.\r\n\r\nCom o fim da Monarquia Constitucional, houve também a dissolução da Assembleia Constituinte e a Convenção Nacional de um novo parlamento. O período da convenção se caracterizou pela forte presença do radicalismo jacobino comandando a Revolução, momento que se tornou conheciso como a fase do Terror (sobretudo por conta do uso indiscriminado da guilhotina como máquina da morte). Nomes como Robespierre, Saint-Just e Danton figuram entre os principais líderes jacobinos. Foi neste período também que a Áustria e Prússia prosseguiram sua guerra contra a França, temendo que a Revolução se espalhasse por seus territórios. No processo de confronto contra essas duas monarquias, nasceu o exército nacional francês, isto é: um exército que, pela primeira vez, não era composto de mercenários e aristocratas, mas do povo de uma nação que se via como nação.\r\n\r\nEm 1795, a burguesia conseguiu retomar o poder e, através de uma nova constituição, instituir uma nova fase à Revolução, chamada o Diretório, órgão composto por cinco membros indicados pelos deputados. Mas a partir deste mesmo ano a crise social se tornou muito ampla na França, o que exigiu um contorno político mais eficaz, sob pena da volta da radicalização jacobina.\r\n\r\nUm dos mais jovens e destacados generais da Revolução, Napoleão Bonaparte, era o nome esperado pela burguesia para dar ordem à situação política francesa. Em 1799, ao regressar do Egito à França, Napoleão encontrou um cenário conspiratório contra o governo do Diretório. Foi neste cenário que ele passou a figurar como ditador, inicialmente, dando o golpe de 18 de Brumário (segundo o calendário revolucionário), e depois como imperador da França. O Período Napoleônico durou de 1800 a 1815 e mudou o cenário político do continente europeu, ao passo que expandiu o ideal nacionalista para várias regiões do mundo.', NULL, '2020-09-10 20:59:04', 2, 3, 4),
(12, 'Revolução Industrial', 'A Revolução industrial foi um conjunto de mudanças que aconteceram na Europa nos séculos XVIII e XIX. A principal particularidade dessa revolução foi a substituição do trabalho artesanal pelo assalariado e com o uso das máquinas.\r\n\r\nAté o final do século XVIII a maioria da população europeia vivia no campo e produzia o que consumia. De maneira artesanal o produtor dominava todo o processo produtivo.\r\n\r\nApesar de a produção ser predominantemente artesanal, países como a França e a Inglaterra, possuíam manufaturas. As manufaturas eram grandes oficinas onde diversos artesãos realizavam as tarefas manualmente, entretanto subordinados ao proprietário da manufatura.\r\n\r\nA Inglaterra foi precursora na Revolução Industrial devido a diversos fatores, entre eles: possuir uma rica burguesia, o fato do país possuir a mais importante zona de livre comércio da Europa, o êxodo rural e a localização privilegiada junto ao mar o que facilitava a exploração dos mercados ultramarinos.\r\n\r\nComo muitos empresários ambicionavam lucrar mais, o operário era explorado sendo forçado a trabalhar até 15 horas por dia em troca de um salário baixo. Além disso, mulheres e crianças também eram obrigadas a trabalhar para sustentarem suas famílias.\r\n\r\nDiante disso, alguns trabalhadores se revoltaram com as péssimas condições de trabalho oferecidas, e começaram a sabotar as máquinas, ficando conhecidos como “os quebradores de máquinas“. Outros movimentos também surgiram nessa época com o objetivo de defender o trabalhador.\r\nO trabalhador em razão deste processo perdeu o conhecimento de todo a técnica de fabricação passando a executar apenas uma etapa.\r\n\r\nA Primeira etapa da Revolução Industrial\r\nEntre 1760 a 1860, a Revolução Industrial ficou limitada, primeiramente, à Inglaterra. Houve o aparecimento de indústrias de tecidos de algodão, com o uso do tear mecânico. Nessa época o aprimoramento das máquinas a vapor contribuiu para a continuação da Revolução.\r\n\r\nA Segunda Etapa da Revolução Industrial\r\nA segunda etapa ocorreu no período de 1860 a 1900, ao contrário da primeira fase, países como Alemanha, França, Rússia e Itália também se industrializaram. O emprego do aço, a utilização da energia elétrica e dos combustíveis derivados do petróleo, a invenção do motor a explosão, da locomotiva a vapor e o desenvolvimento de produtos químicos foram as principais inovações desse período.\r\n\r\nA Terceira Etapa da Revolução Industrial\r\nAlguns historiadores têm considerado os avanços tecnológicos do século XX e XXI como a terceira etapa da Revolução Industrial. O computador, o fax, a engenharia genética, o celular seriam algumas das inovações dessa época.', NULL, '2020-09-10 20:59:12', 2, 3, 4);

